import React from "react";
import { BarChart, LineChart } from "./Charts";

function Dashboard() {
  return (
    <div>
      <h2 style={{ marginLeft: 20 }}>Dashboard</h2>
      <div className="dashboard-charts">
        <div className="chart-box">
          <BarChart />
        </div>
        <div className="chart-box">
          <LineChart />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
